import React from "react";

const Result = ({compressArray, results}) => {
    return (
        <div className="resultContainer">
            <div className="resultContainer">
                <h1>Results</h1>
                <h4>Based on your skills, these are all of the suggested jobs</h4>
            </div>
            <div className="results">
            {results[0]}
                <ul> 
                    {compressArray(results).map((item, index) =>  <li key={index}> {item.value} </li>)}
                </ul>
            </div> 
        </div>
    )
}

export default Result;
